import React from "react";
import { Link } from "react-router-dom";

const markdownFiles = [
  {
    name: "카테고리1",
    files: [
      { name: "대학공부", fileName: "대학공부" }, // fileName은 실제 파일명의 일부입니다.
      { name: "유니티", fileName: "unity" },
    ],
  },
  {
    name: "카테고리2",
    files: [
      { name: "대학공부", fileName: "study" },
      { name: "유니티", fileName: "unity" },
    ],
  },
];

export default function Post() {
  return (
    <div>
      <h2>글</h2>
      <div>
        {markdownFiles.map((folder, index) => (
          <div key={index}>
            <Link to={`/blog/${folder.name}`} key={index}>
              <h3>{folder.name}</h3>
            </Link>
            <ul>
              {folder.files.map((file, fileIndex) => (
                <li key={fileIndex}>
                  <Link to={`/blog/${folder.name}/${file.fileName}`}>{file.name}</Link>
                </li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
}
